import React, { useState } from 'react';
import UserForm from './components/UserForm';
import UserList from './components/UserList';

const App: React.FC = () => {
  const [isAdding, setIsAdding] = useState(false);

  const handleAddUser = () => {
    setIsAdding(true);
  };

  const handleSaveUser = (userData: { name: string; email: string; contact: string; description: string }) => {
    // Implement the logic to save user data to the backend
    console.log('User data saved:', userData);
    setIsAdding(false);
  };

  return (
    <div>
      <button onClick={handleAddUser}>Add User</button>
      {isAdding && <UserForm onSave={handleSaveUser} />}
      <UserList />
    </div>
  );
};

export default App;
